using ObjectiveC;using System;using SwiftSharp.Attributes;using Foundation;namespace UIKit{	//https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIReferenceLibraryViewControllerClassRef/index.html#//apple_ref/occ/cl/UIReferenceLibraryViewController	/// <summary>	/// A UIReferenceLibraryViewController object provides a dictionary service to look up the definition of a word or term from within an app. It should not be used to display wordlists, create a standalone dictionary app, or republish the content in any form.	/// </summary>	[iOSVersion(5)]	public class UIReferenceLibraryViewController : UIViewController	{		/// <summary>		/// Returns whether a definition is available for the given term.		/// </summary>		/// <param name="term">The term to be defined.</param>		/// <returns>true if a definition for term is available; otherwise, false.</returns>		[iOSVersion(5)]		[Export("dictionaryHasDefinitionForTerm")]		public static bool DictionaryHasDefinitionForTerm(string term) { return false; }				/// <summary>		/// Initializes a newly created reference-library view controller to display the definition of the given term.		/// </summary>		/// <param name="term">The term to define.</param>		/// <returns>The newly initialized reference library view controller.</returns>		[iOSVersion(5)]		public UIReferenceLibraryViewController(string term) { }	}}